import React, { Component } from "react";
import FilterItemContainer from './FilterItemContainer';
import { filterCatagories } from "../data/filtercatagorydata";

const FilterItem = props => {

    return (
      <div className="col-lg-3 col-md-6 pt-2" key={props.catagoryData.key}>
        <h6>{props.catagoryData.name}</h6>
        <FilterItemContainer catagoryData={props.catagoryData.options} />
      </div>
    );
}

export default FilterItem;
